<li>Add a new skin Vertical Dark Tabs for creating <a href="https://www.wonderplugin.com/wordpress-tabs/wordpress-vertical-tabs-id9/" target="_blank">WordPress vertical tabs</a></li>
<li>Add a new skin Horizontal Blue Tabs for creating <a href="https://www.wonderplugin.com/wordpress-tabs/responsive-wordpress-tabs-id10/" target="_blank">WordPress horizontal tabs</a></li>
